class Solution {
    //https://leetcode.com/problems/remove-all-adjacent-duplicates-in-string-ii
public:
    string removeDuplicates(string s, int k) {
        bool flag = true;
        while(flag){
            flag = false;
            int n = s.length();
            char c = '-';
            int cnt = 0;
            for(int i = 0;i<n;i++) {
                if(s[i] != c) {
                    c = s[i];
                    cnt=1;
                } else {
                    cnt++;
                    if(cnt==k) {
                        s.erase(i-k+1, k);
                        flag = true;
                        break;
                    }
                }
            }
        }
        
        return s;
    }
};

